import React, { Component } from 'react';
import {} from 'react-native';
import { Text } from '../Themed';

class ChatContainer extends Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render(): React.ReactElement<any> {
    return <Text>Chat</Text>
  }
}

export default ChatContainer;
